INSERT INTO `v1_7382dcfaca88e9d131c193ea7e513c66ca822b4978b70c86a85b37c6612894a5` VALUES (1, 10021, "カオリ（サマー）", 0.0, 0.0, "2019/07/31 12:00:00", 0.0, 110501, 4, 24, 24015, "2030/12/17 14:59:59", 4, "あうぅ～残念さ～\nマジムンに魂を\n奪われちゃったかな～？");
INSERT INTO `v1_7382dcfaca88e9d131c193ea7e513c66ca822b4978b70c86a85b37c6612894a5` VALUES (2, 10021, "カオリ（サマー）", 0.0, 0.0, "2019/07/31 12:00:00", 4.0, 110501, 4, 24, 24016, "2030/12/17 14:59:59", 1, "今日は踊りのキレも悪いよ～\nゴーヤーっぽいもの食べて、元気回復さ～！");
INSERT INTO `v1_7382dcfaca88e9d131c193ea7e513c66ca822b4978b70c86a85b37c6612894a5` VALUES (3, 10021, "カオリ（サマー）", 0.0, 0.0, "2019/07/31 12:00:00", 0.0, 110501, 4, 24, 24017, "2030/12/17 14:59:59", 4, "マジムンだらけで目が回るさ～！\nふらふらさ～！");
INSERT INTO `v1_7382dcfaca88e9d131c193ea7e513c66ca822b4978b70c86a85b37c6612894a5` VALUES (4, 10021, "カオリ（サマー）", 0.0, 0.0, "2019/07/31 12:00:00", 5.2, 110501, 1, 24, 24018, "2030/12/17 14:59:59", 2, "なんくるない、なんくるない\n次、頑張ればいいんだよ～！\n海で泳いで\nリフレッシュするさー！");
INSERT INTO `v1_7382dcfaca88e9d131c193ea7e513c66ca822b4978b70c86a85b37c6612894a5` VALUES (5, 10021, "カオリ（サマー）", 0.0, 0.0, "2019/07/31 12:00:00", 4.2, 110501, 5, 24, 24019, "2030/12/17 14:59:59", 6, "恥ずかしいところ\n見られちゃったね～\n水着？　水着のことじゃないよー？");
INSERT INTO `v1_7382dcfaca88e9d131c193ea7e513c66ca822b4978b70c86a85b37c6612894a5` VALUES (6, 10021, "カオリ（サマー）", 0.0, 0.0, "2019/07/31 12:00:00", 0.0, 110501, 2, 24, 24020, "2030/12/17 14:59:59", 2, "絶好調さ～！　この調子で\n海の平和を取り戻すよ～！\n楽しい夏が待ってるさ～！");
INSERT INTO `v1_7382dcfaca88e9d131c193ea7e513c66ca822b4978b70c86a85b37c6612894a5` VALUES (7, 10021, "カオリ（サマー）", 0.0, 0.0, "2019/07/31 12:00:00", 6.4, 110501, 1, 24, 24021, "2030/12/17 14:59:59", 6, "何匹で襲ってきたって\n私はマブイを落っことさないよ～！\nくしゅん！　あ……\n今のくしゃみで落っこちたかも～？");
INSERT INTO `v1_7382dcfaca88e9d131c193ea7e513c66ca822b4978b70c86a85b37c6612894a5` VALUES (8, 10021, "カオリ（サマー）", 0.0, 0.0, "2019/07/31 12:00:00", 0.0, 110501, 2, 24, 24022, "2030/12/17 14:59:59", 2, "ひーやーさーさー♪\n戦いの後は、踊りを踊って\n気分スッキリさ～！");
INSERT INTO `v1_7382dcfaca88e9d131c193ea7e513c66ca822b4978b70c86a85b37c6612894a5` VALUES (9, 10021, "カオリ（サマー）", 0.0, 0.0, "2019/07/31 12:00:00", 10.08, 110501, 6, 24, 24023, "2030/12/17 14:59:59", 3, "あれ～？　戦ってるうちに\n水着がどっか行っちゃった～？\nねぇキミ、どっかで見なかった～？\nなんで離れるさ～？");
INSERT INTO `v1_7382dcfaca88e9d131c193ea7e513c66ca822b4978b70c86a85b37c6612894a5` VALUES (10, 10021, "カオリ（サマー）", 0.0, 0.0, "2019/07/31 12:00:00", 5.0, 110501, 1, 24, 24024, "2030/12/17 14:59:59", 2, "まだまだ私は元気だよ～！\nマジムンでもなんでも、\nどんとこーいさー♪");
INSERT INTO `v1_7382dcfaca88e9d131c193ea7e513c66ca822b4978b70c86a85b37c6612894a5` VALUES (11, 10021, "カオリ（サマー）", 0.0, 0.0, "2019/07/31 12:00:00", 0.0, 110501, 2, 24, 24025, "2030/12/17 14:59:59", 2, "私の空手は世界最強さ～！\n夏の陽射しと青い海も合わされば、\n向かうところ敵なしだよー！");
